import React, { useEffect, useState } from 'react'
import './Systemblock.css'

function Systemblock(props) {

    let [systemarr, setsystemarr] = useState()
    let [systemarr2, setsystemarr2] = useState([])

    let [page, setpage] = useState(1)

    useEffect(()=>{
        fetch('https://squid-app-9h43v.ondigitalocean.app/api/systems')
        .then(res=>res.json())
        .then(json=>{setsystemarr(json)})
        .then(setsystemarr2(setsystemarr.data))
    },[])



   function loadcontent(){

      return(
        <>
              {
    systemarr2.data.map((statss, index) => (
      <div className="System-card" id={"System-card"+index}> 
        <div className='System-card-img'>
          <img src={statss.attributes.img2} />
          </div>
          <div>
            <h3>{statss.attributes.titel}</h3>
            <button onClick={()=>console.log("visit")}>Visit</button>
          </div>
        
      </div>
  
     ))}
        </>
      )
   }

  return (
    <>
    <div>Systemblock</div>
    <h1>{props.lange}</h1>
    <div className='System-Wrapper'>
    <div className='System-Filter'>

    </div>
    <div className='System-cards'>
    {loadcontent()}
    </div>
     </div>
    </>
  )
}

export default Systemblock
